import React from 'react';
import '../styles/global.css';

const MainPage: React.FC = () => {
  return (
    <div style={{
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      height: '100vh',
      width: '100%',
      flexDirection: 'column',
    }}>
      <h1 
        className="glitter-text"
        style={{
          fontSize: '4rem',
          fontWeight: 'bold',
          letterSpacing: '0.1em',
          marginBottom: '1rem',
        }}
      >
        Moment4U
      </h1>
      <p style={{
        fontSize: '1.2rem',
        opacity: 0.9,
        textAlign: 'center',
        maxWidth: '80%',
        margin: '0',
      }}>
        Upload up to 4 images to create personalized diary!
      </p>
    </div>
  );
};

export default MainPage;
